function googleTranslateElementInit2() {new google.translate.TranslateElement({pageLanguage: 'en',autoDisplay: false}, 'google_translate_element2');};
function createChatboxHTML(elementID){
	  
	  var buttonElement = document.createElement("a");
	  var buttonAttributes = {
		'id': elementID,
		'title': 'Chat',
		'href': "https://miccbusiness.myips.org/ccmwa/chat",
		'target':'_blank',
		'class': 'chat-button'
	  };
	  for([attribute,value] of Object.entries(buttonAttributes)){
		buttonElement.setAttribute(attribute,value);
	  }
	  buttonElement.innerHTML = buttonAttributes['title'];
	  
	  return buttonElement;
	}
	  
  function addChatboxElement(DOMAnchorElement,chatboxButton){
	DOMAnchorElement.appendChild(chatboxButton);
  }
  
  function addChatboxCSS(chatboxButton){
	chatboxButton.style.cssText ='z-index: 999997;'+
		'cursor: pointer;'+
		'padding: 12px 40px;'+
		'border-radius: 10px;' +
		'text-align:center;'+
		'text-decoration:none;'+
		'font-size:17px;' +
		'color:white;' +
		'background-color: #df6425;'+
		'position: fixed;' +            
		'right: 3%;' +
		'bottom: 0;' +
		'font-weight: bold;';
	return chatboxButton;
	}
  
  function checkIfChatboxShouldBeCreated(){
        var dateObject = new Date();
        var dateHour = dateObject.getHours();
        var dateDay = dateObject.getDay();
        if (dateHour >= 8 && dateHour < 17 && dateDay > 0 && dateDay < 6) {
            	var chatboxAnchor = 'chatbox-anchor';
				var mainContentID = 'wrap';
				addChatboxElement(document.getElementById(mainContentID),
					 addChatboxCSS(createChatboxHTML(chatboxAnchor)));
            }

  }
  checkIfChatboxShouldBeCreated();;
function replaceTag(originalElement,conversionTag){
	var replacementElement = document.createElement(conversionTag);
	replacementElement.classList.add(originalElement.classList);
	replacementElement.innerHTML = originalElement.innerHTML;
	originalElement.replaceWith(replacementElement);
  }
  
  function replaceWidgetHeadingH4ToH2(widgetCSSClass){
	var tag = 'h2'
	var headings = document.getElementsByClassName(widgetCSSClass);
	for(let heading of headings ){
		replaceTag(heading,tag);
	  }
  }
  replaceWidgetHeadingH4ToH2('widget-title');;
function getAllLinksInContent() {
            return document.getElementById('content-wrap').getElementsByTagName('a');
        }
        function replaceOldUniformLinks() {
		  if('https://myips.org/ips-back-to-school-2021-22-school-year/ips-revised-uniform-policy-for-the-2021-22-school-year/'!==window.location.href){
            for (let linkInContent of getAllLinksInContent()) {
			  
                let linkHrefUrl = linkInContent.getAttribute('href');
                if (linkHrefUrl) {
                    if (linkHrefUrl.endsWith('2018_07_dress_code_revised.compressed.pdf')) {
                        linkInContent.setAttribute('href', 'https://myips.org/ips-back-to-school-2021-22-school-year/ips-revised-uniform-policy-for-the-2021-22-school-year/');
                    } else if (linkHrefUrl.endsWith('2018_07_dress_code_spanish_revised.compressed.pdf')) {
                        linkInContent.setAttribute('href', 'https://myips.org/wp-content/uploads/2021/07/Uniform-Policy_Spanishv2.pdf');
                    }
                }
            }
        }
		
		}
        replaceOldUniformLinks();;
